    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Alligator River NWR for the next 15 years. This
    plan outlines the Refuge vision and purpose and describes how Alligator River NWR
    will contribute to the overall mission of the Refuge System. The plan provides an
    introduction to the Refuge, an overview of the CCP process, information on plan
    development and management direction, and strategies for plan implementation. Key
    planning issues include: hydrology, fish and wildlife populations, habitats, public
    use, resource protection, administration, and wilderness review.",nt"license_title":
